import { Component } from '@angular/core';

@Component({
  selector: 'app-detalle-pais',
  templateUrl: './detalle-pais.component.html',
  styleUrls: ['./detalle-pais.component.css']
})
export class DetallePaisComponent {

}
<div *ngIf="mostrar">
    <ul>
        <li>Nombre: {{pais.nombre}}</li>
        <li>Tipo: {{pelicula.tipo}}</li>
        <li>Cantidad de personas: {{pelicula.cantidadPersonas}}</li>
        <li>Estreno: {{pelicula.fechaEstreno}}</li>
        <li>Protagonizada por: {{pelicula.actor.nombre}}</li>
    </ul>
</div>
